import React from 'react'
import styled from 'styled-components'
import animationData from "../../assets/LottieJson/details/detail1.json";
import LottieAnimation from "../../lottieScripts/LottieAnimation";


const VideoContainer = styled.div`
width: 80%;
`

const Title = styled.h2`
font-size: ${(props) => props.theme.fontxl};
text-transform: capitalize;
width: 100%;
color: ${(props) => props.theme.text};
textAlign: center;
position: relative;
`;

const Detail1 = () => {
  return (
    <VideoContainer>
        <LottieAnimation animationData={animationData} id="detail1"></LottieAnimation>
        <Title>In-Depth Explainations</Title>
    </VideoContainer>
  )
}

export default Detail1
